import { Card } from 'antd';
import { HeartOutlined, MessageOutlined, RetweetOutlined } from '@ant-design/icons';

const PostCard = ({ post }) => {
    return (
        <div>
            <Card cover={post.Images[0] && <PostImages images={post.images} actions={[<RetweetOutlined />, <HeartOutlined />, <MessageOutlined />]} />}>
                <Image />
                <Content />
                <Button></Button>
            </Card>
            <CommentForm />
            <Comment />
        </div>
    );
};

export default PostCard;
